import { useState } from 'react';
import './App.css';

function App() {
  const [isVisible, setIsVisible] = useState(false);
  return (
    <div className="App">
      <button onClick={()=> setIsVisible((prev)=>!prev)} >
        {isVisible?"Hide":"Show"}
      </button>
    </div>
  );
}

export default App;
